import React, { useState } from 'react';
import axios from 'axios';

const fields = [
  { id: 'Pregnancies', label: 'Pregnancies', min: 0, max: 20, step: 1 },
  { id: 'Glucose', label: 'Glucose', min: 0, max: 300, step: 1 },
  { id: 'BloodPressure', label: 'Blood Pressure', min: 0, max: 200, step: 1 },
  { id: 'SkinThickness', label: 'Skin Thickness', min: 0, max: 100, step: 1 },
  { id: 'Insulin', label: 'Insulin', min: 0, max: 900, step: 1 },
  { id: 'BMI', label: 'BMI', min: 0, max: 70, step: 0.1 },
  { id: 'DiabetesPedigreeFunction', label: 'Diabetes Pedigree Function', min: 0, max: 2.5, step: 0.001 },
  { id: 'Age', label: 'Age', min: 0, max: 120, step: 1 },
];

export default function DiabetesForm() {
  const [form, setForm] = useState({});
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: Number(e.target.value) });
  };

  const handleSubmit = async e => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    setResult(null);

    try {
      const resp = await axios.post(
        // Change to your Flask URL in production
        `${process.env.REACT_APP_API_URL || ''}/predict`,
        form,
        { headers: { 'Content-Type': 'application/json' } }
      );

      const { prediction } = resp.data;
      const feedback =
        prediction === 'Diabetic'
          ? 'Please consult your doctor for proper diagnosis and treatment.'
          : 'You seem healthy, keep up the good lifestyle!';

      setResult({ prediction, feedback });
    } catch (err) {
      const msg =
        err.response?.data?.error ||
        err.message ||
        'Could not connect to server.';
      setError(msg);
    } finally {
      setLoading(false);
    }
  };

  const handleReset = () => {
    setForm({});
    setResult(null);
    setError(null);
  };

  return (
    <form onSubmit={handleSubmit} style={{ display: 'grid', gap: '12px' }}>
      {fields.map(f => (
        <label key={f.id} style={{ display: 'flex', flexDirection: 'column' }}>
          {f.label}:
          <input
            type="number"
            name={f.id}
            min={f.min}
            max={f.max}
            step={f.step}
            required
            onChange={handleChange}
            style={inputStyle}
          />
        </label>
      ))}

      <div style={{ display: 'flex', gap: '10px', marginTop: '10px' }}>
        <button type="submit" disabled={loading} style={primaryBtn}>
          {loading ? 'Predicting…' : 'Predict'}
        </button>
        <button type="button" onClick={handleReset} style={secondaryBtn}>
          Reset
        </button>
      </div>

      {(result || error) && (
        <div
          style={{
            marginTop: '20px',
            padding: '15px',
            borderRadius: '6px',
            textAlign: 'center',
            background: result
              ? result.prediction === 'Diabetic'
                ? '#f8d7da'
                : '#d4edda'
              : '#f8d7da',
            color: result
              ? result.prediction === 'Diabetic'
                ? '#721c24'
                : '#155724'
              : '#721c24',
          }}
        >
          {error ? (
            <>Error: {error}</>
          ) : (
            <>
              <strong>Prediction: {result.prediction}</strong>
              <br />
              <br />
              {result.feedback}
            </>
          )}
        </div>
      )}
    </form>
  );
}

/* ---------- Inline styles (mirrors your original CSS) ---------- */
const inputStyle = {
  width: '100%',
  padding: '8px 10px',
  fontSize: '15px',
  border: '2px solid #dce3e8',
  borderRadius: '6px',
  transition: 'border-color .3s',
};

const primaryBtn = {
  flex: 1,
  padding: '12px',
  fontSize: '17px',
  fontWeight: '700',
  color: '#fff',
  backgroundColor: '#3498db',
  border: 'none',
  borderRadius: '6px',
  cursor: 'pointer',
};

const secondaryBtn = {
  flex: 1,
  padding: '12px',
  fontSize: '17px',
  fontWeight: '700',
  color: '#fff',
  backgroundColor: '#95a5a6',
  border: 'none',
  borderRadius: '6px',
  cursor: 'pointer',
};
